# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - django.http.response.HttpResponse~Subclass
    - basicauth
    - Member[decorators].Member[HttpResponseUnauthorized]
  - - django.http.response.HttpResponse~Subclass
    - basicauth
    - Member[middleware].Member[HttpResponseUnauthorized]
  - - django.http.response.HttpResponse~Subclass
    - basicauth
    - Member[response].Member[HttpResponseUnauthorized]
  - - django.http.response.HttpResponse~Subclass
    - basicauth
    - Member[response].Member[HttpResponse]
